import React from 'react'
import './navBtn/navBtn'
import navBtn from './navBtn/navBtn'
export const navBar = (props) => {
    const buttons = [main,shops,cart]
    
    return (

        
        <ul>
            {buttons.map(button =>{
                return(
                    <navBtn name={button} />
                )
            })}    
        </ul>
    )
}

export default navBtn;
